components:
  schemas:
    availabilityModel:
      type: object
      required:
        - id
        - name
        - manufacturer
        - releaseDate
      properties:
        startDate:
          type: string
          format: date-time
          example: '2016-08-29 09:12:00'
        endDate:
          type: string
          format: date-time
          example: '2016-08-29 09:12:00'
        timezoneid:
          type: string
          format: TimeZone ID
          example: America/Detroit
        format_to:
          type: string
          description: >-
            an appropriate timezone. find more info here
            https://github.com/moment/luxon/blob/master/docs/zones.md#specifying-a-zone
          example: America/Los_Angeles
        repetitions:
          type: string
          description: >-
            any one of the following are acceptable entries(
            min,hour,day,week,month,year)
          example: mon
        interval:
          type: integer
          example: 1
        count:
          type: integer
          example: 500
        eventduration:
          type: integer
          example: 55
        byweekday:
          type: string
          description: >-
            leave this blank or use a string of comma separated short english
            day names
          example: mon, tues, fri
        minuteoffset:
          type: integer
          description: you can use this to hardset the minute the repetitions fall upon
          example: 0
        houroffset:
          type: integer
          description: >-
            you can use this to hardset an hour start time apart from the start
            time of the repetitions
          example: 0
        beginningbuffer:
          type: integer
          example: 5
        sundayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example: null
        mondayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example:
            - - 540
              - 720
            - - 780
              - 960
        tuesdayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example:
            - - 540
              - 720
        wednesdayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example: null
        thursdayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example:
            - - 540
              - 720
            - - 780
              - 960
        fridayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example:
            - - 540
              - 720
            - - 780
              - 960
        saturdayAvail:
          type: array
          items:
            type: array
            items:
              type: integer
          example: null
        blocked_date_time_ranges:
          type: array
          items:
            type: array
            items:
              type: string
          example:
            - - '2022-12-31 12:00:00'
              - '2022-12-31 14:00:00'
            - - '2022-11-31 12:00:00'
              - '2022-11-31 21:00:00'
